import React, { useEffect, useState } from 'react';
import axios from 'axios';
// Remove CSS import if the module doesn't exist
// import styles from './styles/Dashboard.module.css';

const Dashboard = () => {
  const [email, setEmail] = useState('');
  const [feedbacksByDate, setFeedbacksByDate] = useState({});
  const [message, setMessage] = useState('');
  const [link, setLink] = useState('');
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const storedEmail = localStorage.getItem('email');
    if (storedEmail) {
      setEmail(storedEmail);
      fetchFeedback(storedEmail);
    } else {
      setMessage('No logged-in user. Please log in.');
      setIsLoading(false);
    }
  }, []);

  const fetchFeedback = async (emailToFetch) => {
    setIsLoading(true);
    try {
      console.log('Fetching feedback for email:', emailToFetch);
      const response = await axios.get(`http://localhost:5000/api/feedback/${emailToFetch}`);
      console.log('Received feedback data:', response.data);
      
      const grouped = groupByDate(response.data);
      setFeedbacksByDate(grouped);
      setMessage('Feedbacks loaded successfully');
      setLink(`http://localhost:3000/send-feedback?email=${encodeURIComponent(emailToFetch)}`);
    } catch (error) {
      console.error('Error fetching feedback:', error);
      setMessage(error.response?.data?.message || 'Failed to load feedbacks');
    } finally {
      setIsLoading(false);
    }
  };

  const groupByDate = (feedbacks) => {
    return feedbacks.reduce((acc, fb) => {
      const date = new Date(fb.createdAt).toLocaleDateString('en-CA');
      if (!acc[date]) acc[date] = [];
      acc[date].push(fb);
      return acc;
    }, {});
  };

  const handleCopy = () => {
    navigator.clipboard.writeText(link).then(() => {
      alert('Inbox URL copied to clipboard!');
    }).catch(() => {
      // Fallback for older browsers
      const textArea = document.createElement('textarea');
      textArea.value = link;
      document.body.appendChild(textArea);
      textArea.select();
      document.execCommand('copy');
      document.body.removeChild(textArea);
      alert('Inbox URL copied to clipboard!');
    });
  };

  const handleRefresh = () => {
    if (email) {
      fetchFeedback(email);
    }
  };

  if (isLoading) {
    return (
      <div style={{ 
        minHeight: '100vh', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'center',
        backgroundColor: '#f8f9fa'
      }}>
        <div>Loading...</div>
      </div>
    );
  }

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#5d9cdb', 
      padding: '20px' 
    }}>
      <div style={{ 
        textAlign: 'center', 
        marginBottom: '40px' 
      }}>
        <h1 style={{ 
          fontSize: '48px', 
          fontWeight: 'bold', 
          color: 'black',
          margin: 0,
          textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
        }}>
          Incognito Inbox
        </h1>
      </div>

      <div style={{ 
        display: 'flex', 
        gap: '20px', 
        maxWidth: '1200px', 
        margin: '0 auto',
        flexWrap: 'wrap'
      }}>
        {/* Your Inbox Link Card */}
        <div style={{ 
          backgroundColor: 'white', 
          borderRadius: '12px', 
          padding: '24px',
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
          flex: '1',
          minWidth: '300px'
        }}>
          <h3 style={{ 
            fontSize: '20px', 
            fontWeight: '600', 
            marginBottom: '16px',
            color: '#212529'
          }}>
            Your Inbox Link
          </h3>
          
          <p style={{ 
            color: '#6c757d', 
            fontSize: '14px', 
            marginBottom: '12px' 
          }}>
            Share this link to receive anonymous feedback
          </p>
          
          <div style={{ 
            backgroundColor: '#f8f9fa', 
            padding: '12px', 
            borderRadius: '6px',
            marginBottom: '12px',
            wordBreak: 'break-all',
            fontFamily: 'monospace',
            fontSize: '12px',
            border: '1px solid #dee2e6'
          }}>
            {link}
          </div>
          
          <button 
            onClick={handleCopy} 
            style={{
              width: '100%',
              padding: '10px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '6px',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer'
            }}
          >
            Copy
          </button>
        </div>

        {/* Feedback Received Card */}
        <div style={{ 
          backgroundColor: 'white', 
          borderRadius: '12px', 
          padding: '24px',
          boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
          flex: '2',
          minWidth: '400px'
        }}>
          <div style={{ 
            display: 'flex', 
            justifyContent: 'space-between', 
            alignItems: 'center',
            marginBottom: '16px'
          }}>
            <h3 style={{ 
              fontSize: '20px', 
              fontWeight: '600', 
              margin: 0,
              color: '#212529'
            }}>
              Feedback Received
            </h3>
            
            <button
              onClick={handleRefresh}
              style={{
                padding: '6px 12px',
                backgroundColor: '#28a745',
                color: 'white',
                border: 'none',
                borderRadius: '4px',
                fontSize: '12px',
                cursor: 'pointer'
              }}
            >
              Refresh
            </button>
          </div>
          
          {message && (
            <p style={{ 
              color: message.includes('Failed') ? '#dc3545' : '#6c757d',
              fontSize: '14px',
              fontStyle: 'italic',
              marginBottom: '16px'
            }}>
              {message}
            </p>
          )}
          
          <div style={{ maxHeight: '600px', overflowY: 'auto' }}>
            {Object.keys(feedbacksByDate).length === 0 ? (
              <div style={{ 
                textAlign: 'center', 
                padding: '40px',
                color: '#6c757d'
              }}>
                <div style={{ fontSize: '48px', marginBottom: '16px' }}>📭</div>
                <p>No feedback received yet.</p>
                <p style={{ fontSize: '14px' }}>Share your inbox link to start receiving feedback!</p>
              </div>
            ) : (
              Object.entries(feedbacksByDate)
                .sort(([a], [b]) => new Date(b) - new Date(a)) // Sort by date descending
                .map(([date, feedbacks]) => (
                  <details key={date} open style={{ marginBottom: '16px' }}>
                    <summary style={{ 
                      padding: '12px',
                      backgroundColor: '#e9ecef',
                      borderRadius: '6px',
                      cursor: 'pointer',
                      fontWeight: '500',
                      color: '#495057',
                      marginBottom: '8px'
                    }}>
                      ▼ {new Date(date).toLocaleDateString('en-US', { 
                        weekday: 'long',
                        year: 'numeric',
                        month: 'long',
                        day: 'numeric'
                      })} ({feedbacks.length} feedback{feedbacks.length !== 1 ? 's' : ''})
                    </summary>
                    
                    <div style={{ paddingLeft: '16px' }}>
                      {feedbacks.map((fb, index) => (
                        <div key={fb._id} style={{ 
                          backgroundColor: '#f8f9fa',
                          padding: '16px',
                          borderRadius: '8px',
                          marginBottom: '12px',
                          border: '1px solid #dee2e6'
                        }}>
                          <div style={{ 
                            display: 'flex', 
                            justifyContent: 'space-between',
                            alignItems: 'flex-start',
                            marginBottom: '8px'
                          }}>
                            <h4 style={{ 
                              margin: 0,
                              fontSize: '16px',
                              fontWeight: '600',
                              color: '#212529'
                            }}>
                              {fb.subject || 'No Subject'}
                            </h4>
                            
                            <small style={{ 
                              color: '#6c757d',
                              fontSize: '12px',
                              whiteSpace: 'nowrap',
                              marginLeft: '12px'
                            }}>
                              {new Date(fb.createdAt).toLocaleTimeString('en-US', {
                                hour: '2-digit',
                                minute: '2-digit'
                              })}
                            </small>
                          </div>
                          
                          {fb.subject && !fb.subject.includes('No Subject') && (
                            <div style={{ 
                              fontSize: '12px',
                              color: '#6c757d',
                              marginBottom: '8px'
                            }}>
                              Subject: {fb.subject}
                            </div>
                          )}
                          
                          <p style={{ 
                            margin: 0,
                            lineHeight: '1.5',
                            color: '#495057',
                            whiteSpace: 'pre-wrap'
                          }}>
                            {fb.message}
                          </p>
                        </div>
                      ))}
                    </div>
                  </details>
                ))
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
